import React from "react";
import { Link } from "react-scroll";
import Dropdown from './Dropdown/Dropdown'
import './menu.css'
import Fresh from './Fresh/Fresh'
import Fillet from './Fillets/Fillet'

function Menu() {
	return (
			<div>
			<div className="fnBar"><Dropdown/></div>
			<Fresh></Fresh>
			<Fillet></Fillet>
			</div>
	
	);
}
export default Menu;
